    name: spellchecker
    extensions:
      - md
      - ipynb
    attrs:
      - markdown
    type: stream
    args:
      - /nix/store/dnbdxp1gzdxf031za7l08fq3770hli00-markdown-spellcheck-lsp-wrapped/bin/markdown-spellcheck-lsp
