    extensions:
      - py
    attrs:
      - python
    type: stream
    args:
      - /nix/store/502vi5x5c2mxyggy08hfh9wbbim4m4cp-python3.9-jedi-language-server-0.40.0/bin/jedi-language-server
    notebook_suffix: .py
